        <div>
            <Card.Footer style={{ background: '#52627F', padding: "4px" }}>
                <Container>
                    <Row>
                        <Col style={{ color: '#fff' }}>
                            <small > Â© Hack Your Future 2020</small>
                        </Col>
                    </Row>
                </Container>
            </Card.Footer>
        </div>
    )
}

export default Footer;
